sys_variable_value.value:
(function execute(inputs, outputs) {
  
  var arrayToUpdate = JSON.parse(inputs.input_array);
  var idLimit = inputs.number_of_ids;

  var idArray = arrayToUpdate.map(function(item) {
    return item.ID;
  });

  var shuffledArray = idArray.sort(function() {
    return 0.5 - Math.random();
  });
  
  if (idLimit) { // Check if idLimit is not empty
    outputs.output_csv = shuffledArray.slice(0, idLimit).join(','); // Return only the first "idLimit" number of elements
  } else {
    outputs.output_csv = shuffledArray.join(','); // Return all IDs
  }

})(inputs, outputs);

